INSERT INTO `QUERYLIST` VALUES (1,'Total number of endoscopic examination for different country from January 1, 2010 to December 31, 2010.\r','SELECT Country, COUNT( Report_ID ) AS TotalNum\rFROM Examination, Patient\rWHERE Examination.Patient_ID = Patient.PID\rAND Endoscopy_Date\rBETWEEN \'2010-1-1\'\rAND \'2010-12-30\'\rGROUP BY Country',1),(2,'Top 5 diagnoses for those patients who received endoscopic examination and the number of cases for each diagnosis from January 1, 2010 to December 31, 2010.\r','SELECT Diagnoses_Text, COUNT( Diagnoses_Text ) AS Num\rFROM Examination\rGROUP BY Diagnoses_Text\rHAVING COUNT( Diagnoses_Text ) >0\rLIMIT 5\r',2),(3,'Age profile of endoscopic patients from January 1, 2010 to December 31, 2010 – i.e. Number of dialysis patients belonging to each of the age bracket [below 18; 18 to below 40; 40 to below 60; 60 and above]\r','SELECT * \nFROM (\n\nSELECT DISTINCT COUNT( PID ) AS NumBelow18\nFROM Patient, Examination\nWHERE Patient.PID = Examination.Patient_ID\nAND YEAR( CURRENT_DATE( ) ) - YEAR( DoB ) <18\n) AS NumBelow18, (\n\nSELECT DISTINCT COUNT( PID ) AS Num18to40\nFROM Patient, Examination\nWHERE Patient.PID = Examination.Patient_ID\nAND YEAR( CURRENT_DATE( ) ) - YEAR( DoB ) \nBETWEEN 18 \nAND 40\n) AS Num18to40, (\n\nSELECT DISTINCT COUNT( PID ) AS Num40to60\nFROM Patient, Examination\nWHERE Patient.PID = Examination.Patient_ID\nAND YEAR( CURRENT_DATE( ) ) - YEAR( DoB ) \nBETWEEN 40 \nAND 60\n) AS Num40to60, (\n\nSELECT DISTINCT COUNT( PID ) AS NumAbove60\nFROM Patient, Examination\nWHERE Patient.PID = Examination.Patient_ID\nAND YEAR( CURRENT_DATE( ) ) - YEAR( DoB ) >60\n) AS NumAbove60\nSELECT Gender, COUNT( Patient_ID ) AS NumberofPatients\nFROM ClinicalDetection, Patient\nWHERE ClinicalDetection.Patient_ID = Patient.PID\nAND Times =1\nAND HBsAg =0\nAND Patient_ID\nIN (\nSELECT Patient_ID\nFROM ClinicalDetection\nWHERE Times =3\nAND AntiHBs =0\n)\nGROUP BY Gender\n',3),(4,'Number of patients for each gender who are still susceptible to developing a Hepatitis B infection even after full compliance to the Hepatitis B vaccination schedule —i.e. The baseline and second detection dates for the HBsAg and Anti-HBs tests turn out to be both negative results.\r','SELECT Gender,COUNT(Patient_ID) AS NumberofPatients FROM ClinicalDetection,patient WHERE ClinicalDetection.Patient_ID=patient.PID AND Times=1 AND HBsAg=0 AND Patient_ID IN (SELECT Patient_ID FROM ClinicalDetection WHERE Times=3 AND AntiHBs =0) GROUP BY Gender',4);
